package main

import "fmt"

func main() {
	//fmt.Println(minWindow("", ""))
	fmt.Println(minWindow("bBbaBAbaAB", "bbB"))
}

/**
 * ==========  ==========
 *  S T S  T 
 * ==========  ==========
 * 1. 
 * 2.  L T 
 * 3. L  T 
 * 4.  T  T  2 
 */
func minWindow(s string, t string) string {
	sLen := len(s)

	if sLen == 0 {
		return ""
	}

	tLen := len(t)

	if tLen == 0 || tLen > sLen {
		return ""
	}

	maps := make(map[byte]int)

	for i := 0; i < len(t); i ++ {
		maps[t[i]]++
	}

	minLeft, minRight, left, right := 0, 0, 0, 1
	for left <= sLen - tLen && right <= sLen {

		nm := make(map[byte]int)

		for k, v := range maps {
			nm[k] = v
		}

		if contains(s, left , right , nm) {
			if  right - left < minRight - minLeft || minRight == 0 {
				minLeft = left
				minRight = right
			}

			left ++
		} else {
			right ++
		}
	}

	return s[minLeft:minRight]
}

func contains(s string, left int, right int, t map[byte]int) bool {
	for i := left; i < right; i ++ {
		if t[s[i]] > 0 {
			t[s[i]] --
		}
	}

	for _, v := range t {
		if v > 0 {
			return false
		}
	}

	return true
}